// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import 'solmate/src/tokens/ERC721.sol';
import '@openzeppelin/contracts/access/Ownable.sol';

contract Polygon721 is ERC721, Ownable {

    uint256 public constant MAX_SUPPLY = 10000;
    uint256 public cost = 0.05 ether;
    uint256 public minted;
    string public uri = "https://nftstorage.link/ipfs/bafkreic6xug4ia6n2ogb5b5vfmjmrvjuhypii6cek4uwaf7wi4mgyupse4";

    constructor() payable ERC721("Polygon NFT", "POLYNFT") {}

    // MODIFIERS

    modifier isCorrectPayment() {
        require(cost == msg.value, "Incorrect ETH value sent");
        _;
    }

    modifier isAvailable() {
        require(minted + 1 <= MAX_SUPPLY, "No more left");
        _;
    }

    // PUBLIC

    function mint(address _to) external payable isCorrectPayment isAvailable {
        _safeMint(_to, minted++);
    }

    // ADMIN

    function setCost(uint256 _cost) external onlyOwner {
        cost = _cost;
    }

    // VIEW

    function tokenURI(uint256 _tokenId) public view override returns (string memory) {
        // just the same uri for all NFTs
        return uri;
    }
}

